import React from 'react';
import './Topnav.css';


function Topnav () {
    return (
        <div className="topnav">
            <nav className="navbar">
                <a className="navbar-brand" href="/">
                    <img src="./logo" alt="" />
                </a>
            </nav> 
        </div>
    );
}

export default Topnav;
